import React from 'react'
import { Heading, Text, Button } from '@chakra-ui/react'
const LandingPage = () => {
  return (
    <div className='page'>
        <Heading>Starting new projects, made more productive</Heading>
        <Text>Muse, list out your learnings and plan your objectives</Text>
        <Button color="primart"></Button>
    </div>
  )
}

export default LandingPage
